import React,{setState} from 'react'
import ListComponent from './ListComponent'
function Button() {
    let [name , setName ] = setState('')
    const handleClick = ()=>{
        setName('kalyani')
    }
  return (
    <div>
        <button onClick={handleClick}>click</button>
        <ListComponent name={name}></ListComponent>
    </div>
  )
}

export default Button;
